static int s_get_index_of_formula(char* s) 
{	
	int res = 0;
    for (uint8_t i = 0; i < 29; i++) {
        if (strcmp(s, FORMULA_POOL[i]) == 0) {
            res = i;
			break;
        }
    }
	return res;
}


